import React from 'react';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';

export default function () {
  const iframe = css`
    border: 0" 
    width="1200" 
    height="800" 
    frameborder="0" 
    scrolling="no"
  `;
  return (
    <iframe
      css={iframe}
      title="Wolfi's calender"
      src="https://calendar.google.com/calendar/embed?src=f465l00qe0q7vj38scdq4oibsg%40group.calendar.google.com&ctz=Europe%2FVienna"
    ></iframe>
  );
}
